import React from 'react'


const Day = ({icon, text, maxtemp_c, mintemp_c, date}) => {
    return (
        <div>
            <img src={icon} alt={text} />
            <span>{`${maxtemp_c}/${mintemp_c}`}</span>
            <span>{date}</span>
        </div>
    )
}

export default Day
